import React from "react";
import styled from "styled-components";

const StyledButton = styled.button`
  border: none;
  border-radius: 10px;
  font-size: 30px;
  font-weight: bold;
  padding: 0.25rem 1rem;
  color: black;
  outline: none;
  cursor: pointer;

  background: white;
  &:hover {
    background: #bcbcbc;
  }
`;

const Button = () => <StyledButton />;

export default Button;
